import React from 'react';
import './App.css';
import Fragment from 'render-fragment';




class App extends React.Component {


  render() {
    return (
      <Fragment>

      <body> 

          <section id="sideMenu">
            <nav>

             <a href="#" class="active"> Item </a>
            <a href="#"> Item1 </a>
            <a href="#"> Item2 </a>
            <a href="#"> Item3 </a>

            </nav>


          </section>
      </body>
    </Fragment>
    );
  }

}


export default App;
